    public static function createName( $sFirstname , $sLastname , $sMI , $sDesignation )
    {
        return trim( $sFirstname . ' ' . $sMI . ' ' . $sLastname . ' ' . $sDesignation );
    }

    public static function convertToSrc( $imagePath )
    {
        $oAppConfig = Zend_Registry::get( 'config' );
        return str_replace( '\\' , '/' , str_replace( $oAppConfig->folder->publicdir , "" , $imagePath ) );
    }

